import { StatusBar } from 'expo-status-bar';
import React from 'react';
import { Button, StyleSheet, TouchableOpacity, Text, View } from 'react-native';
import logo from './assets/Logo.png'

const styles = StyleSheet.create({
  page: {
    flex: 1,
    backgroundColor: '#252B63',
    alignItems: 'center',
  },
  textpos:{
    position: 'absolute',
    top: '50%',
  },
  picpos:{
    position: 'absolute',
    top: '10%',
    width: '15%'
  },
  maintext:{
    font: 'Poppins',
    'font-weight': 'bold',
    color: 'white',
    'font-size': '25px',

  },
  subtext:{
    font: 'Poppins',
    color: 'white',
    'font-size': '20px',
  },
});

const element = <Text> Hello </Text>

 function App() {
  return (
    <View style={styles.page}>
      <View style={styles.picpos}>
        <img width={'100%'} src={logo}/>
      </View>
      <View style={styles.textpos}>
        <Text style={styles.maintext}>Get your Priority </Text>
        <Text style={styles.subtext}>Easy way to get ahead!</Text>
      </View>
      <Button title="Hey there!" />
    </View>
  );
}






export default App
